import axios from 'axios'

export const getContests = () => {
	return async (dispatch) => {
		try {
			const response = await axios.get('http://34.204.190.112:6060/contests')

			console.log("CONTESTS response", response)
		}catch(error){
			throw new Error(error.message)
		}
	}
}
